import React from 'react'

const PopularMovies = () => {
    [movies, setMovies] = React.useState(null)

    React.useEffect(() => {
        fetch('/api')
            .then((res) => res.json())
            .then((data) => setMovies(data.message))
    }, []);

    return (
        <>
        <div>{!movies ? 'Loading' : movies } </div>
        </>

    )
}

export default PopularMovies;
